-- Create kuja data to temporal export tables
CREATE TEMP TABLE export_kohde (
    old_id bigint,
    tunniste character varying(255),
    meta jsonb,
    luoja text,
    luontipvm timestamp without time zone,
    paivittaja text,
    paivityspvm timestamp without time zone
);

CREATE TEMP TABLE export_lupa (
    old_id bigint,
    edellinen_lupa_id bigint,
    paatoskierros_id bigint,
    lupatila_id bigint,
    asiatyyppi_id bigint,
    diaarinumero character varying(20),
    jarjestaja_ytunnus character varying(10),
    jarjestaja_oid character varying(255),
    alkupvm date,
    loppupvm date,
    paatospvm date,
    meta jsonb,
    maksu boolean,
    luoja text,
    luontipvm timestamp without time zone,
    paivittaja text,
    paivityspvm timestamp without time zone,
    koulutustyyppi character varying,
    oppilaitostyyppi character varying,
    asianumero character varying(16)
);

CREATE TEMP TABLE export_maarays (
    parent_id bigint,
    lupa_id bigint,
    kohde_id bigint,
    koodisto character varying(255),
    koodiarvo text,
    arvo character varying(255),
    maaraystyyppi_id bigint,
    meta jsonb,
    luoja text,
    luontipvm timestamp without time zone,
    paivittaja text,
    paivityspvm timestamp without time zone,
    koodistoversio integer,
    org_oid character varying(255)
);




-- Add temporally columns for kuja ids
ALTER TABLE kohde ADD COLUMN kuja_id BIGINT;
ALTER TABLE lupa ADD COLUMN kuja_id BIGINT;

WITH kuja_kohteet AS (
        SELECT tunniste, meta, old_id, '3' FROM export_kohde RETURNING id, kuja_id
),
     kuja_luvat AS (
             SELECT paatoskierros_id, lupatila_id, CASE WHEN asiatyyppi_id != 2 THEN 1 ELSE 2 END, diaarinumero, jarjestaja_ytunnus, jarjestaja_oid, alkupvm, loppupvm, paatospvm, meta, luontipvm, koulutustyyppi, oppilaitostyyppi, asianumero, old_id
                FROM export_lupa el RETURNING id, kuja_id
     ),
     kuja_maaraykset AS (
            SELECT parent_id, kl.id, kk.id, koodisto, koodiarvo, arvo, maaraystyyppi_id, meta, luoja, paivittaja, paivityspvm, koodistoversio, org_oid
                FROM export_maarays em, kuja_luvat kl, kuja_kohteet kk WHERE kk.kuja_id = em.kohde_id AND kl.kuja_id = em.lupa_id
     )

SELECT * from kuja_kohteet;

-- Clean up
ALTER TABLE kohde DROP COLUMN kuja_id;
ALTER TABLE lupa DROP COLUMN kuja_id;
DROP TABLE export_kohde, export_maarays, export_lupa;
