INSERT INTO export_maarays VALUES (NULL, 734, 4, 'vsterityinenkoulutustehtava', '1', NULL, 1, '{"erityinenkoulutustehtävämääräys-0": "Oppilaitoksen erityisenä koulutustehtävänä on antaa steinerpedagogista opettajankoulutusta."}', NULL, '2020-03-03 10:22:35.778492', NULL, NULL, NULL, NULL),
(NULL, 730, 1, 'kunta', '091', NULL, 1, '{}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 734, 3, 'koulutustehtava', 'fi', NULL, 1, '{"koulutustehtävämääräys-0": "Snellman-korkeakoulu on valtakunnallinen oppilaitos, jonka tehtävänä on steinerpedagogiselta pohjalta kehitettyjen yleissivistävien opintojen järjestäminen. Tavoitteena on yksilön kykyjen, fyysisten, psyykkisten sekä henkisten voimavarojen herättäminen ja keinojen tarjoaminen näiden kykyjen elinikäiselle ja tasapainoiselle kehittämiselle.", "koulutustehtävämääräys-1": "Yleisopinnot toimivat elämänhallintaan ja työelämässä jaksamiseen suuntautuvana sekä sosiaalisten taitojen ja taiteellisen luovuuden kehittämiseen pyrkivänä elinikäisen oppimisen linjana ja myös perustana jatko-opinnoille Snellman-korkeakoulussa. Muuta, pääasiassa steinerpedagogiikalle pohjautuvaa koulutusta ovat mm. puhe-ja draamataiteen, goetheanistisen kuvataiteen sekä biodynaamisen viljelyn ja luonnonhoidon koulutus."}', NULL, '2020-03-03 10:22:35.778492', NULL, NULL, NULL, NULL),
