(NULL, 18, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Valkealan kristillisen kansanopiston koulutus perustuu luterilaisen kansankirkon tunnustukseen ja herännäisyyden perinteisiin ja uskonnäkemykseen. Koulutus painottuu terveyteen ja hyvinvointiin liittyvään koulutukseen. Opisto tuottaa kasvatukseen, ohjaukseen ja avustamiseen sekä harrastusten tukemiseen koulutusta. Lisäksi opisto järjestää taustayhteisönsä tarpeisiin perustuvaa koulutusta sekä suomen kielen ja kulttuurin koulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
