(NULL, 19, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Varsinais-Suomen Kansanopiston koulutus painottuu yleissivistävään kulttuurialan koulutukseen musiikin, teatterin sekä kuvallisen ja sanallisen ilmaisun aloilla. Koulutus edistää ihmisen kokonaisvaltaista kehittymistä, osallisuutta ja eri  elämänvaiheiden aktiivista kansalaisuutta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
