(NULL, 20, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Vuolle-opiston kansanopiston koulutus perustuu setlementtiliikkeen arvopohjaan. Koulutuksessa painottuvat taide- ja taitoaineet, luonto- ja ympäristöaineet, yhteiskunnalliset aineet sekä kasvua ja hyvinvointia tukevien aineiden opetus. Opisto järjestää lisäksi maahanmuuttajakoulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 21, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kristliga folkhögskolan i Nykarleby anordnar utbilding med mål att väcka, utveckla och stärka såväl personligt trosliv som samhälleligt ansvar utifrån kristen människosyn och kristet livsideal. Folkhögskolan anordnar utbilning om kyrka och samhälle, i språk och i kulturämnen, inom vård och omsorg samt integrationsfrämjande utbildning. Folkhögskolans utbildningar svarar mot de regionalde behov som finns inom kyrkan och inom invandrarutbildningen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
