(NULL, 23, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Työväen Akatemia järjestää aktiivista kansalaisuutta, kansainvälisyyttä ja tasa-arvoa edistäviä opintoja tukeutuen kansanvaltaisuuden ja demokratian periaatteisiin. Koulutus painottuu yhteiskunnallisiin, humanistisiin sekä käyttäytymistieteen alaan kuuluviin aineisiin. Opisto järjestää lisäksi kieli-, kulttuuri- ja kansainvälisyyskoulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
