(NULL, 28, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Västra Nylands folkhögskola anordnar utbildning som baserar sig på en humanistisk värdegrund. Folkhögskolan anordnar utbildning i konst, språk och samhällsorienterande ämnen med särskild vikt vid en bred konstfostran, en levande tvåspråkighet och ett internationellt och mångkulturellt samhällsperspektiv. Därtill ordnar folkhögskolan utbildning inom skärgård och natur. Folkhögskolan anordnar utbildning även för invandrare inom nämnda ämnesområden. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
