(NULL, 731, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Simpelejärven opiston koulutuksen tavoitteena on edistää opiskelijan kehittymistä, elinikäistä oppimista, osallisuutta, hyvinvointia ja aktiivista kansalaisuutta. Opisto järjestää koulutusta, joka painottuu taito- ja taideaineisiin, kieliin, kotitalouteen, tietotekniikkaan ja terveyttä edistäviin aineisiin.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
