(NULL, 30, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Suomen Diakoniaopiston kansanopiston perustana on kristillisestä arvopohjasta nouseva sosiaalieettinen ja diakoninen toiminta, jonka tavoitteena on koulutuksellinen ja sosiaalinen ulkopuolisuuden ehkäisy. Koulutuksessa painottuvat kestävä kehitys, kansainvälisyys, luova ilmaisu sekä eri opiskelijaryhmien jatko-opintoihin ja elämänhallinnan valmiuksiin orientoiva koulutus.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 737, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Hämeen kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää myös työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutustarjonnassa painottuvat humanistiset alat, taiteet ja kulttuuri, kasvatusala, kauppa, hallinto ja oikeustiede, luonnontieteet, maatalous- ja metsätiede, tekniikka, lääketiede, terveys ja hyvinvointi, sosiaalitieteet sekä yhteiskuntatieteet."}', NULL, '2020-03-23 14:37:54.85359', NULL, NULL, NULL, NULL),
