(NULL, 732, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kymenlaakson Opisto on grundvigilainen kansanopisto. Opiston koulutus painottuu kulttuuri- ja taideaineisiin, kieliin ja kansainvälisyyteen sekä maahanmuuttajakoulutukseen. Opisto järjestää lisäksi työllisyyttä edistäviä koulutuksia sekä siirtymävaiheiden valmistavaa ja jatko-opintoihin valmentavaa koulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 39, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Perheniemen evankelisen opiston koulutus pohjautuu kristilliseen uskoon ja ihmiskäsitykseen. Koulutus painottuu terveyteen ja sielunhoitoon liittyviin aineisiin, kristilliseen uskoon ja elämään valmentavaan koulutukseen sekä aktiivista kansalaisuutta tukevaan koulutukseen. Opisto järjestää lisäksi taito- ja taideaineiden koulutusta sekä monikulttuurisuuteen ja kansainvälisyyteen liittyvää koulutusta. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
