(NULL, 734, 8, NULL, '', NULL, 1, '{"oppilaitoksentarkoitus-0": "Snellman-korkeakoulun tarkoituksena on edistää opiskelijoiden inhimillistä ja ammatillista kehitystä. Lähtökohtana on laaja-alainen käsitys sivistyksestä, johon kuuluu filosofisia, tieteellisiä, taiteellisia ja eettis-käytännöllisiä opintoja. Toiminnassa painottuu steinerpedagoginen ja fenomenologinen lähestymistapa, joka pyrkii ottamaan huomioon myös ihmisen ja maailman henkisen ulottuvuuden. Koulutuksen tueksi kehitetään siihen liittyvää tutkimusta ja pyritään laajaan kansalliseen ja kansainväliseen yhteistoimintaan, varsinkin vuorovaikutukseen muiden opettajankoulutuslaitosten kanssa."}', NULL, '2020-03-03 10:22:35.778492', NULL, NULL, NULL, NULL),
