(NULL, 41, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Otavan Opiston koulutus painottuu aktiiviseen kansalaisuuteen, vuorovaikutteiseen mediaan, tulevaisuudenmetodologiaan, kestävään kehitykseen, ympäristövaikuttamiseen ja globaaliin vastuuseen liittyviin koulutuksiin. Koulutus sisältää kansalaisjärjestöjen toimijoille ja kansalaisille järjestettäviä koulutuksia, oppimisen muotojen uudistamista sekä työ- ja muiden yhteisöjen oppimisen vahvistamista ja koulutusta. Opisto järjestää myös etäopetusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
