(NULL, 48, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Lahden kansanopisto on arvo- ja aatetaustaltaan sitoutumaton. Koulutus pohjautuu pohjoismaisesta kansanopistoperinteestä nousevaan demokraattiseen ihmis- ja yhteiskuntakäsitykseen sekä humanistisiin arvoihin. Opiston koulutus painottuu kansainvälisyyttä ja kulttuurien välistä tuntemusta edistävään ja yhteiskunnalliseen koulutukseen, kieliin ja viestintään, taiteisiin ja luovaan toimintaan sekä kasvatus-, sosiaali- ja terveystietoon liittyvään koulutukseen. Opisto järjestää lisäksi henkilökohtaisia valmiuksia vahvistavaa ja työelämään orientoivaa koulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
