(NULL, 69, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Folkhögskolans utbildningsuppgift är byggd på klassiska kristna värderingar med Bibeln som norm. Utbildningen svarar på de bildningsbehov som uppkommer lokalt och nationellt i Svenskfinland med närområden. Utbildningen har en särskild betoning på språk, kultur, musik och media, juridiska och teologiska ämnen samt praktiska ämnen. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
