(NULL, 108, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "MSL-opintokeskuksen koulutus ja opintokerhotoiminta perustuu alkiolaisten arvojen mukaisiin sivistys-, koulutus- ja kehittämistavoitteisiin. Opintokeskus järjestää jäsenistön ja yhteistyökumppaneiden kehittämistavoitteiden mukaista pedagogisesti monipuolista koulutusta. Koulutuksen ja opintokerhojen sisällöissä painottuvat yhteiskunnallinen aktiivisuus, yrittäjyys, kestävä kehitys, kansainvälisyys, monikulttuurisuus ja luovuus.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
