(NULL, 109, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "KSL-opintokeskus on vasemmistolainen oppilaitos, jonka koulutus pohjaa järjestöoppimiseen, yhteiskunnalliseen oppimiseen ja kulttuurioppimiseen. Koulutuksen ja opintokerhojen sisällöt painottuvat kansalaisaktiivisuuden lisäämiseen, järjestötoiminnan osaamisen kehittämiseen sekä yksilöiden ja yhteisöjen hyvinvoinnin edistämiseen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
