(NULL, 112, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Työväen Sivistysliitto TSL ry:n opintokeskuksen koulutustehtävä pohjautuu työväenliikkeen arvomaailmaan. Koulutuksen ja opintokerhojen painotuksia ovat yhteiskunnallinen, koulutuksellinen ja sivistyksellinen tasa-arvo, monikulttuurisuus ja maahanmuuttajien kotoutumisen tukeminen, solidaarisuus, sosiaalinen oikeudenmukaisuus, ihmisarvon kunnioitus, kestävä kehitys, kansainvälisyys ja suvaitsevaisuus.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
