(NULL, 113, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Opintokeskus Kansalaisfoorumi on kulttuurisen ja yhteisöllisen sivistystyön oppilaitos, joka luo ympäristöjä yksilöiden ja yhteisöjen sivistymiselle sekä ihmisten ja kulttuurien väliselle vuorovaikutukselle. Pedagogiikan lähtökohtana on omaehtoisuus, vertaisuus ja yhteisöllinen oppiminen. Koulutuksessa ja opintokerhoissa painottuvat taito- ja taideaineet, jäsenyhteisöjen ja opintoryhmien toimintaedellytyksiä lisäävä ohjaaja-, järjestö- ym. koulutus sekä jäsenyhteisöjen kehityshankkeita tukeva koulutus.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
