(NULL, 487, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Esbo arbetarinstitut järjestää toimintaympäristön muutosten mukaista, ajankohtaista ja kuntalaista aktivoivaa vapaan sivistystyön koulutusta. Keskeisenä kasvatustavoitteena on edistää omaehtoista oppimista, hyvinvointia ja terveyttä sekä työelämävalmiuksia. Opisto järjestää koulutusta humanistisissa aineissa, liikuntaa ja terveyttä edistävissä aineissa sekä taito- ja taideaineissa. Opisto järjestää maahanmuuttajien kotoutumista tukevaa ja integroitumista edistävää koulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
