(NULL, 617, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Saarijärven kansalaisopisto järjestää koulutusta, jonka tavoitteena on kehittää toimintaalueen asukkaiden tietoja ja taitoja sekä lisätä heidän osallistumistaan oman yhteisönsä toimintaan, sen kehittämiseen ja hyvinvoinnin varmistamiseen. Tavoitteena on lisäksi avoimesti ja myönteisesti monikulttuurisuuteen ja kansainvälisyyteen suuntautuvan yhteisöllisyyden kehittyminen. Koulutus painottuu tieto-, taito- ja taideaineisiin sekä terveyttä ja hyvinvointia edistävään koulutukseen. Opisto järjestää maahanmuuttajakoulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
