(NULL, 643, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Turun suomenkielinen työväenopisto järjestää koulutusta, jonka tavoitteena on kartuttaa kuntalaisten sivistyspääomaa sekä yhteiskunnassa ja elämässä tarvittavia tietoja ja taitoja. Tavoitteena on lisäksi tukea koulutukseen osallistuvien elämänhallintaa, vähentää sosiaalista eriarvoisuutta, ennaltaehkäistä syrjäytymistä sekä vahvistaa yhteiskunnan eheyttä. Koulutuksessa painottuvat vieraat kielet, kädentaitoaineet, taideaineet, tieto- ja viestintätekniikka sekä terveyden edistäminen. Koulutusta kohdennetaan erityisesti muun koulutuksen ulkopuolelle jäävälle väestölle. Opisto järjestää kieli- ja kulttuurikoulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
