(NULL, 655, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Vuolle-opiston kansalaisopisto järjestää koulutusta, joka perustuu setlementtiliikkeen arvopohjaan. Koulutuksessa painottuvat musiikki, tanssi ja muut taideaineet, taitoaineet, kielet, yhteiskunnalliset aineet, terveyttä ja hyvinvointia edistävät sekä hyvää ikääntymistä tukevat aineet. Opisto järjestää koulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
