(NULL, 657, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Meän Opisto järjestää koulutusta, jonka tavoitteena on edistää omaehtoista oppimista, yhteisöllisyyttä ja osallisuutta. Opiston koulutus painottuu kieliin, kädentaitoihin, musiikkiin, tietotekniikkaan ja terveyttä edistäviin aineisiin. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 660, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Institutet anordnar utbildning utgående från en jämlik, rättvis och pluralistisk grund. Utbildningen har en betoning på konst- och färdighetsämnen, språk samt hälsofrämjande ämnen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
