(NULL, 658, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Ylivieskan kansalaisopisto järjestää koulutusta, jonka tavoitteena on edistää sivistyksellistä tasa-arvoa vapaan sivistystyön arvojen ja ihanteiden pohjalta. Koulutuksessa painottuvat kielet, taide- ja taitoaineet, tietotekniikka sekä terveyttä ja hyvinvointia edistävät aineet. Opisto järjestää suomen kielen ja kulttuurin koulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
