(NULL, 659, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Helsingfors stads svenska arbetarinstitut utgår i sin utbildning frän en humanistisk och social värdegrund. Institutet fäster vikt vid det helsingforsiska och ett mångkulturellt samhälle. Institutet anordnar utbildning främst i följande ämnesområden: musik och bildkonst, hantverk, motion och hälsa, informationsteknik, natur, kultur och samhällsämnen, språk och pedagogik.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
