(NULL, 661, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Valamon opisto on kaikille avoin hengellinen ja yhteisöllinen oppimisympäristö, joka järjestää ortodoksiseen ihmiskäsitykseen ja elämännäkemykseen perustuvaa koulutusta. Koulutus vahvistaa vastuullista kansalaisuutta, kansalaisyhteiskunnan yhteisöllistä ja moraalista perustaa, antaa mahdollisuuden ortodoksiseen uskoon ja elämään tutustumiseen sekä valmiuksia jatko-opintoihin. Valamon opisto järjestää ortodoksisen uskon, perinteen, kirkkotaiteen ja kädentaitojen koulutusta, ortodoksisesta perinteestä lähtöisin olevaa hyvän elämän koulutusta sekä koulutusta aktiiviseen kansalaisuuteen, vapaaehtoistoimintaan ja sosiaaliseen toimintaan.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
