(NULL, 663, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Reisjärven kristillisen opiston koulutus perustuu vanhoillislestadiolaisen herätysliikkeen kristillisiin arvoihin. Koulutuksessa painottuvat arvokasvatus, omaehtoinen oppiminen, vastuullisuus, yhteisöllisyys ja osallisuus. Uskontokasvatus ja -opetus pohjaa Raamattuun ja evakelis-luterilaisen kirkon tunnustukseen. Koulutuksen painoalueita ovat yleissivistävät ja yhteiskunnalliset aineet. Opisto järjestää lisäksi taustayhteisönsä tarpeisiin perustuvaa koulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
