(NULL, 666, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Pohjantähti-opiston koulutus vastaa alueelliseen sivistystarpeeseen sekä edistää erityistä tukea tarvitsevien opiskelijoiden yleissivistystä ja henkistä kasvua. Koulutus painottuu yleissivistäviin aineisiin, taito- ja ilmaisuaineisiin sekä kansalaistaitoja vahvistaviin aineisiin. Opisto järjestää koulutusta myös lastensuojelua käsittelevistä aiheista.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
