(NULL, 667, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kiljavan opisto järjestää aktiivista kansalaisuutta, yhteiskunnallista kiinnostusta ja kansalaisten kulttuuritarpeiden toteutumista edistäviä opintoja tukeutuen kansanvaltaisuuden sekä demokratian periaatteisiin. Opisto järjestää koulutusta erityisesti työelämän järjestö- ja luottamustehtävissä toimiville aikuisille SAK:laisen ammattiyhdistysliikkeen järjestöjen piirissä, viestintäkoulutusta ja opiskelijoiden työelämä- sekä opiskeluvalmiuksia kehittävää koulutusta nuorille ja aikuisille. Opisto järjestää lisäksi maahanmuuttajakoulutusta painottaen suomalaisen työelämäjärjestelmän ja työelämätaitojen osaamista.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
