(NULL, 668, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Metallityöväen Murikka-opiston valtakunnallisena tehtävänä on edistää työelämän yhteistyötaitoja, työhyvinvointia ja yhdenvertaisuutta työelämässä. Metallityöväen Murikka-opisto järjestää työelämässä, erityisesti teollisuudessa toimiville aikuisille yleissivistystä, työelämävalmiuksia ja oppimisvalmiuksia parantavaa koulutusta ammattiyhdistysliikkeen arvomaailman pohjalta. Metallityöväen Murikka-opisto järjestää työelämän luottamustoimiin liittyvää koulutusta. Opisto voi järjestää myös muuta kansanopistokoulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 669, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kuurojen kansanopisto järjestää monikulttuurisessa, esteettömässä ja viittomakielisessä oppimisympäristössä koulutusta kuuroille, kuurosokeille, kuulomonivammaisille ja huonokuuloisille. Koulutus parantaa opiskelijoiden yleissivistystä, edistää heidän mahdollisuuksiaan jatko-opintoihin sekä laajentaa heidän yhteiskunnallista tietämystään ja yhteisöllistä osallisuuttaan. Lisäksi opisto järjestää viittomakielen opetusta kuuleville.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
