(NULL, 672, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kalajoen Kristillisen Opiston koulutus pohjautuu kristilliseen ihmiskäsitykseen. Opiston koulutuksessa korostetaan yksilöllisyyttä, yhteisöllisyyttä ja suvaitsevaisuutta. Koulutuksessa painottuvat hyvinvointiin, kasvatus- ja sosiaalialaan, taiteisiin, seurakuntatyöhön, teologiaan sekä kansainvälisyyteen liittyvät aineet.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
