(NULL, 673, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Itä-Karjalan Kansanopiston arvopohja perustuu grundtvigilaiseen ihmiskäsitykseen, jonka pohjalta se edistää yhteiskunnan eheyttä ja aktiivista kansalaisuutta. Koulutuksessa painottuvat sosiaali-, hoiva- ja palvelualat, taide-, taito- ja viestintäaineet, matkailu ja kielet, suomen kieli ja kulttuuri sekä kansainvälisyyteen perehdyttävä koulutus. Opisto järjestää koulutusta myös maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
