(NULL, 701, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Etelä-Pohjanmaan kesäyliopisto järjestää avointa korkeakouluopetusta, opetus- ja muiden alojen, erityisesti korkeakoulutettujen ammattilaisten osaamista vahvistavaa sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman ikä-, pohjakoulutus- tai muita vaatimuksia. Koulutustarjonta painottuu aluetieteellisiin, kauppatieteellisiin, yhteiskuntatieteellisiin, terveys- ja lääketieteellisiin, maa- ja metsätaloustieteellisiin, humanistisiin ja filosofisiin aineisiin sekä kulttuuri- ja taideaineisiin."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
