(NULL, 707, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Keski-Pohjanmaan kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää myös työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutustarjonnassa painottuvat yhteiskunnallisten aineiden, liiketalouden ja hallinnon ala, humanistinen ja kasvatusala, kulttuuriala, luonnontieteiden ala, sosiaali- ja terveysala sekä matkailu- ja talousala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
