(NULL, 713, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Päijät-Hämeen kesäyliopisto järjestää avointa korkeakouluopetusta, kielikoulutusta, ammatillista osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Päijät-Hämeen kesäyliopiston koulutustarjonnassa painottuvat opetus- ja kasvatusala, sosiaali- ja terveysala sekä julkishallinnon ja elinkeinoelämän piirissä tarpeelliset koulutukset."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 712, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Porin kesäyliopiston ydintehtävä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää lisäksi työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta, kuten kielikursseja ja ikääntyvien yliopistokoulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutuksessa painottuvat yhteiskunnalliset aineet, juridiikan ja hallinnon ala, humanistinen ja kasvatusala, kulttuuriala, luonnontieteiden ala, sosiaali- ja terveysala sekä sosiaali- ja terveydenhuollon ala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
