(NULL, 717, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Snellman-kesäyliopisto järjestää avointa korkeakouluopetusta ja muuta ammatillisiin ja sivistystarpeisiin vastaavaa vapaan sivistystyön koulutusta. Kesäyliopiston koulutuksessa painottuvat humanistiset ja yhteiskuntatieteelliset sisällöt."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 719, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Turun kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää lisäksi työelämässä tarvittavia taitoja ja osaamista kehittävää omaehtoista koulutusta, kieli- ja kulttuurikoulutusta sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa ja ilman pohjakoulutus-, ikä- tai muita vaatimuksia. Koulutuksessa painottuvat sosiaali-, terveys- ja liikunta-ala, humanistinen ja kasvatusala, yhteiskuntatieteiden, liiketalouden ja hallinnon ala sekä kulttuuriala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 720, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Vaasan kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää lisäksi työelämässä tarvittavia taitoja ja osaamista edistävää omaehtoista koulutusta ja muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutuksessa painottuvat liiketaloustieteelliset, yhteiskuntatieteelliset ja kasvatustieteelliset alat sekä humanistiset aineet."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
