(NULL, 40, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Peräpohjolan Opiston koulutus perustuu grundtvigilaiseen arvopohjaan. Koulutus painottuu kasvatusaineisiin sekä hyvinvoinnin ja luonto- ja elämystoiminnan koulutukseen. Opisto järjestää lisäksi opiskelutaitojen ja elämänhallinnan opetusta erityisryhmät huomioiden sekä kulttuuri- ja muuta yleissivistävien aineiden koulutusta. Opisto järjestää myös etäopetusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 111, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "DSL:n opintokeskuksen koulutustehtävä perustuu rauhan, kansainvälisyyden, humanismin, demokratian sekä marxismin ja sosialismin aatteisiin, joiden pohjalta tuetaan yksilöiden monipuolista kehittymistä ja kykyä toimia yhteisöissä, syventää valtiollista ja yhteiskunnallista tietoisuutta kansanvaltaisuuden edistämiseksi sekä kohottaa yleistä sivistystasoa. Koulutuksen ja opintokerhojen sisällöissä painottuvat yhteiskunnalliset aineet ja järjestökoulutus, monikulttuurisuus ja kulttuuri sekä ohjaaja- ja johtamiskoulutus.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 519, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Jyvälän kansalaisopiston koulutus perustuu setlementtiliikkeen arvopohjaan. Koulutuksen tavoitteissa korostuvat yksilön monipuolinen kehittyminen, osallisuus ja vaikuttaminen yhteisöissä. Koulutuksessa painottuvat taito- ja taideaineet sekä kehon ja mielen hyvinvointiin liittyvät aineet. Opisto järjestää kieli- ja kulttuurikoulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
