(NULL, 560, 7, 'yleissivistavankoulutusmuodot', '3', NULL, 1, NULL, 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 711, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Pohjois-Pohjanmaan kesäyliopiston pääasiallisena tehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää lisäksi työelämätaitoja ja -osaamista kehittävää ja muuta vapaan sivistystyön koulutusta. Kesäyliopisto järjestää myös ikääntyvien yliopistokoulutusta ja maahanmuuttajien koulutusta. Koulutuksessa painottuvat humanistiset, yhteiskuntatieteelliset, kasvatustieteelliset, oikeustieteelliset, sosiaali- ja terveystieteelliset aineet sekä taito- ja taideaineet, kulttuuri ja kielet."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 632, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Järvi-Saimaan kansalaisopisto edistää alueen kaikkien väestö- ja ikäryhmien osaamista, hyvinvointia, osallisuutta ja arjessa selviytymistä. Opiston koulutuksessa painottuvat taide- ja taitoaineet, terveyttä edistävät opinnot, kielet, tietoteknisiä valmiuksia sekä muita kansalaisvalmiuksia ja alueen elinvoimaisuutta edistävät aineet.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 650, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Soisalo-opisto järjestää koulutusta, jonka tavoitteena on edistää osallistujien monipuolista kehittymistä ja hyvinvointia, moniarvoisuutta ja monikulttuurisuutta sekä tukea yhteisöllisyyttä ja aktiivista kansalaisuutta. Koulutus painottuu kieliin, taito- ja taideaineisiin, terveyttä ja hyvinvointia sekä tietoyhteiskuntavalmiuksia edistäviin aineisiin.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 714, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Tampereen kesäyliopisto järjestää avointa korkeakouluopetusta sekä muuta ammatillisiin ja sivistyksellisiin osaamistarpeisiin vastaavaa vapaan sivistystyön koulutusta, mukaan lukien ikääntyvien yliopistokoulutus ja maahanmuuttajakoulutus. Koulutuksessa painottuvat yhteiskunnallinen, liiketalouden ja hallinnon ala, humanistinen ja kasvatusala, kulttuuriala, luonnontieteiden ala sekä sosiaali- ja terveysala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
