(NULL, 715, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Lapin kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää myös työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia. Koulutuksessa painottuvat yhteiskuntatieteiden, liiketalouden ja hallinnon ala, humanistinen ja kasvatusala, kulttuuriala, luonnontieteiden ala, sosiaali- ja terveysala, teologinen ala sekä matkailuala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 705, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Jyväskylän kesäyliopisto järjestää avointa korkeakouluopetusta, työelämän valmiuksia ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta mukaan lukien ikääntyvien yliopistokoulutus. Kesäyliopiston koulutustarjonnassa painottuvat oikeustieteelliset, yhteiskunnalliset, luonnon- ja terveystieteelliset sekä taidealojen aineet ja aihealueet."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 709, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Mikkelin kesäyliopisto järjestää avointa korkeakouluopetusta sekä työelämässä tarvittavia taitoja ja osaamista kehittävää ja tietoja päivittävää sekä muuta vapaan sivistystyön koulutusta, mukaan lukien ikääntyvien yliopisto. Koulutukseen voi osallistua ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Kesäyliopiston tarjonnassa painottuvat yhteiskunnalliset aineet, sosiaali- ja terveysala, julkishallinto-, elinkeinoelämä, taloushallinto ja yritysjuridiikka sekä opetus -, kasvatus- ja kulttuuri."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 32, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Karkun evankelisen opiston koulutus perustuu Raamattuun ja evankelisluterilaisen kirkon tunnustukseen, jonka pohjalta se järjestää yhteiskunnan eheyttä, tasa-arvoa ja aktiivista kansalaisuutta tukevaa koulutusta. Opiston koulutuksessa painottuvat raamattukoulutus ja hengellistä elämää rakentava koulutus sekä muu yleissivistävä ja sosiaalisesti vahvistava koulutus. Opisto järjestää lisäksi musiikkikoulutusta, luontomatkailuun liittyvää koulutusta, maahanmuuttajakoulutusta ja perheiden tukemiseen liittyvää koulutusta.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 37, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Päivölän Kansanopiston koulutus painottuu yhteiskunnallisiin, humanistisiin ja luonnontieteen alaan kuuluviin aineisiin sekä kansainvälisyyttä ja kulttuurin tuntemusta edistävään koulutukseen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 29, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Savonlinnan kristillisen opiston koulutus pohjaa kristillisiin perusarvoihin. Koulutuksessa painotetaan sosiaalisuuden vahvistamista ja erityisryhmien huomioimista. Opiston koulutus painottuu taide-, taito-, kulttuuri- ja musiikkiaineisiin. Opisto järjestää lisäksi maahanmuuttajakoulutusta sekä kieli- ja kansainvälisyyskoulutusta. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 76, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Alkio-opiston koulutus perustuu alkiolaiseen perinteeseen, jonka pohjalta se järjestää ihmisenä kasvamiseen, yhteiskunnan eheyteen, tasa-arvoon, aktiiviseen kansalaisuuteen, kestävään kehitykseen ja maailmanlaajuiseen tietoisuuteen herättävää opetusta. Koulutus painottuu humanistiseen, yhteiskunnalliseen ja käyttäytymistieteiden alaan liittyvään koulutukseen sekä luonnontieteiden, terveyden, viestinnän, kulttuurin ja kädentaitojen alan koulutukseen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 609, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Medborgarinstitutet Raseborg anordnar utbildning i konstämnen, motion och dans, handens färdigheter och språk samt aktuella samhällsinriktade och kulturrelaterade ämnen. En viktig tyngpunkt är att ge undervisning i de basfärdigheter som behövs i informationssamhället.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
