(NULL, 574, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Medborgarinstitutet anordnar utbildning som har som mål att tillgodose kommuninvånarnas behov av utökade kunskaper och främja deras intressen ur ett välmående-, medborgarfärdighets- och jämlikhetsperspektiv. Institutet anordnar utbildning med betoning på hantverks-, konst- och färdighetsämnen, språk och hälsofrämjande ämnen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
