(NULL, 547, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Korsholms vuxeninstitut anordnar utbildning med betoning på medborgarkunskaper och -färdigheter i främst språk, data, praktisk-estetiska färdigheter, musik och hälsosam livsstil. Enligt behov kompletteras och utvecklas ämnesområden för att garantera individer och samhälle en relevant och hög bildningsnivå motsvarande aktuella och nya krav.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
