(NULL, 553, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kristinestads medborgarinstitut arrangerar utbildning med särskild vikt på en levande tvåspråkighet. Utbildningen är huvudsakligen kopplad till ämnesgrupper i språk, musik, konstfostran, praktiska färdigheter, informations- och kommunikationsteknik samt hälsofrämjande och samhällsrelaterade ämnen. Institutet ger undervisning för invandrare.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 561, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Kaskikuusen kansalaisopisto järjestää koulutusta, jonka tavoitteena on tukea kuntalaisten hyvinvointia ja yleissivistystä sekä lisätä heidän valmiuksiaan toimia aktiivisesti muuttuvassa yhteiskunnassa. Koulutuksen painoalueina ovat kädentaidot, musiikki, kuvataiteet, kielet, tietotekniikka sekä terveyttä edistävät aineet. Opisto järjesää suomen kielen ja kulttuurin koulutusta maahanmuuttajille. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 88, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Läroanstaltens utbildningsuppgift inom fritt bildningsarbete är att erbjuda fria studier inom idrott. Därtill har läroanstalten som uppgift att utveckla utbildningen inom det fria bildningsarbetet på sitt eget kompetensområde och att sprida sådan kompetens i nätverket för idrottsutbildningscenter. Läroanstalten ska samarbeta med friviiligorganisationer inom motion och idrott.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 610, 7, 'yleissivistavankoulutusmuodot', '3', NULL, 1, NULL, 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 107, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Svenska studiecentralen svarar mot det finlandssvenska medborgarsamhällets utbildnings- och kompetensbehov. Speciell fokus i utbildningen och studiecirklarna läggs på handledning av individer och facilitering av grupper med betoning på innehållen som befrämjar egenmakt och social inklusion, aktivt medborgarskap och det livsvida lärandet.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
