(NULL, 84, 4, 'vsterityinenkoulutustehtava', '1', NULL, 1, '{"erityinenkoulutustehtävämääräys-0": "", "erityinenkoulutustehtävämääräys-1": "", "erityinenkoulutustehtävämääräys-2": "Oppilaitoksella on huippu-urheilun erityinen koulutustehtävä, joka tarkoittaa huippu-urheilussa vaadittavan osaamisen ja asiantuntijapalveluiden kehittämistä ja jakamista liikunnan koulutuskeskusverkostossa sekä koko urheilun järjestelmissä. Lisäksi tehtävä tarkoittaa kehittämistoiminnan ja testauksen toteuttamista yhteistyössä muiden urheilutoimijoiden kanssa."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
