(NULL, 716, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Savonlinnan kesäyliopisto järjestää avointa korkeakouluopetusta ja muuta vapaan sivistystyön koulutusta. Koulutuksessa painottuvat musiikki ja kulttuuri, kasvatus ja opetus sekä hallinnon ja yhteiskunnallisen alan aineet."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 702, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Hämeen kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää myös työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutuksessa painottuvat yhteiskunnalliset aineet, luonnontieteet, liiketalouden ja hallinnon ala, humanistinen ja kasvatusala, kulttuuriala, sosiaali- ja terveysala sekä matkailu- ja talousala."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 704, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Helsingin seudun kesäyliopisto järjestää avointa korkeakouluopetusta sekä muuta yleissivistävää vapaan sivistystyön koulutusta. Kesäyliopiston koulutuksessa painottuvat humanistinen ja kasvatusala, kulttuuri- ja viestintäala, yhteiskunnalliset aineet, liiketalouden ja hallinnon ala, tekniikan ja luonnontieteiden alat, sosiaali-, terveys- ja liikunta-ala sekä ympäristöala. Kesäyliopisto järjestää lisäksi maahanmuuttajien kieli- ja kulttuurikoulutusta."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 708, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Kymenlaakson kesäyliopiston ydintehtävänä on avoimen korkeakouluopetuksen järjestäminen. Kesäyliopisto järjestää myös työelämässä tarvittavia taitoja ja osaamista kehittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua elämän eri vaiheissa, ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Koulutustarjonnassa painottuvat sosiaali- ja terveysala, kasvatus- ja kulttuuriala, humanistinen ja yhteiskuntatieteellinen ala, hallinnon ja talouden ala, taideala erityisesti kuvataide, luonnontieteiden ala sekä matkailu."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 710, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Pohjois-Karjalan kesäyliopisto järjestää avointa korkeakouluopetusta sekä muuta ajankohtaista yksilöllisiin ja työelämässä tarvittaviin osaamis- ja sivistystarpeisiin vastaavaa vapaan sivistystyön koulutusta. Koulutusta järjestetään eri kohderyhmille, mukaan lukien maahanmuuttajat, koulutuksessa aliedustetut ja korkeakoulutetut. Koulutuksen painoalueita ovat opetus ja kasvatus, sosiaali- ja terveysala, laki ja oikeus, hallinto, talous ja elinkeinoelämä, yhteiskunnalliset ja humanistiset aineet sekä kulttuuri."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 593, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Medborgarinstitutet anordnar utbildning som har som mål att ge studerandena färdigheter till personlig utveckling, utveckla studie- och medborgarfärdigheter, väcka intresse för livslångt lärande och stöda studerandenas fysiska och psykiska hälsa. Utbildningen har en betoning på konst- och färdighetsämnen, språk, hälsofrämjande ämnen, datateknik samt samhällsriktade ämnen.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 595, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Medborgarinstitutet anordnar utbildning som, på så jämlika grunder som möjligt, tillgodoser kommuninvånarnas behov av utbildning. Medborgarinstitutet anordnar utbildning med betoning på musik, konst- och hantverksämnen, språk, hälsofrämjande ämnen samt utbildning som syftar till bevarande av kulturarvet.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 623, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Seinäjoen kansalaisopiston koulutus perustuu koulutuksellisen tasa-arvon sekä sivistyksellisen ja alueellisen saavutettavuuden arvolähtökohtiin. Kansalaisopisto järjestää koulutusta, jossa painottuvat taito-, taide- ja ilmaisuaineet, kielet, yhteiskunnalliset aineet, kasvatusalan opinnot sekä terveyttä ja hyvinvointia edistävä koulutus. Opisto järjestää kieli- ja kulttuurikoulutusta maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 38, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Ranuan kristillisen kansanopiston koulutus perustuu vanhoillislestadiolaisen herätysliikkeen kristillisiin arvoihin. Koulutuksessa painottuvat arvokasvatus, omaehtoinen oppiminen, vastuullisuus, yhteisöllisyys ja osallisuus. Uskontokasvastus pohjaa Raamattuun ja evankelis-luterilaisen kirkon tunnustukseen. Koulutuksen painoalueita ovat yleissivistävät ja yhteiskunnalliset aineet. Opisto järjestää lisäksi taustayhteisönsä tarpeisiin perustuvaa koulutusta. ", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 670, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-0": "Luther-opiston koulutus pohjautuu kristillisiin, herännäisyyden sekä sosiaalieettisiin ja diakonisiin arvoihin. Opiston koulutus painottuu seurakunnalliseen ja kirkolliseen toimintaan liittyvään koulutukseen sekä kristillisen kasvatuksen ja uskonnonpedagogiikan sisältöihin ja diakoniakoulutukseen. Opisto järjestää myös kasvatus- ja perheiden hyvinvointia tukevaa koulutusta, kansainvälisyys-, kulttuuri-, kansalaistaito- ja yhteiskuntakoulutusta sekä työelämässä jaksamista ja aktiivista kansalaisuutta edistävää koulutusta. Lisäksi opisto järjestää koulutusta taide- ja ilmaisuaineissa sekä yleissivistävissä aineissa. Opiston koulutus painottuu myös luonto- ja elämysaineisiin ja hyvinvointia edistävien aineiden ja liikunnan koulutukseen. Opisto järjestää koulutusta myös maahanmuuttajille.", "koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": ""}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 703, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Etelä-Karjalan kesäyliopisto järjestää avointa korkeakouluopetusta ja muuta alueen sivistys- ja osaamistarpeisiin vastaavaa vapaan sivistystyön koulutusta. Kesäyliopiston koulutustarjonnassa painottuvat opetusala ja varhaiskasvatus, sosiaali- ja terveysala, hallinto, kulttuuri, ympäristö ja ekologia. Kesäyliopisto ottaa huomioon tarjonnassaan alueen erityislaadusta nousevat taito- ja osaamistarpeet mukaan lukien seniorit ja maahanmuuttajat."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
(NULL, 706, 3, 'koulutustehtava', '1', NULL, 1, '{"koulutustehtävämääräys-1": "", "koulutustehtävämääräys-2": "Kainuun kesäyliopisto järjestää avointa korkeakouluopetusta sekä työelämässä tarvittavia taitoja ja osaamista kehittävää ja tietoja päivittävää sekä muuta vapaan sivistystyön koulutusta. Koulutukseen voi osallistua ilman pohjakoulutus-, ikä- tai muita vaatimuksia ja ilman erillistä hakumenettelyä. Kesäyliopiston tarjonnassa painottuvat yhteiskunnalliset aineet, sosiaali- ja terveysala, julkishallinto-, elinkeinoelämä, taloushallinto ja yritysjuridiikka sekä opetus, kasvatus ja kulttuuri."}', 'kuja', '2018-09-07 10:28:32.06573', NULL, NULL, NULL, NULL),
